<div class="entities" style="line-height: 2.5; direction: ltr">Genetic variants in pre-eclampsia : a meta-analysis . BACKGROUND Pre-eclampsia has a clear familial component , suggesting that the condition may be partly attributable to genetic susceptibility . The search for susceptibility genes has led to a drastic increase in the number of published studies associating genetic factors with pre-eclampsia . However , attempts to replicate these findings have yielded inconsistent results . This meta-analysis assessed the pooled effect of each genetic variant that is reproducibly associated with pre-eclampsia . METHODS Studies that assessed the association between genes and pre-eclampsia were searched in PubMed , Embase and Web of Science . We selected all genetic variants that were significantly associated with pre-eclampsia in an initial study and were subsequently independently reproduced in at least one additional study . All studies that assessed these reproduced variants were then included . The association between genetic variants and pre-eclampsia was calculated at the allele level , and the main measure of effect was a pooled odds ratio in a random-effects model . RESULTS The literature search yielded 2965 articles , of which 542 investigated genetic associations in pre-eclampsia . We identified 22 replicated genetic variants , of which 7 remained significantly associated with pre-eclampsia following meta-analysis . These variants were in or near the following genes :

<div class="entities" style="line-height: 2.5; direction: ltr">A cell-based luciferase-dependent assay for the quantitative determination of free extracellular adenosine with paracrine signaling activity . Extracellular adenosine exerts powerful paracrine effects on immune cells . Thus , adenosine signaling has to be strictly regulated . This is achieved by its rapid internalization or enzymatic degradation . Consequently , free adenosine is extremely difficult to measure in cell culture systems and may escape from detection by time-consuming endpoint measurements like high-performance liquid chromatography ( HPLC ) . Therefore , we have now developed a highly sensitive assay which enables the quantification of biologically relevant extracellular adenosine via the activation of an ectopically expressed 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 - 293 reporter cells . Binding of the short-lived nucleoside to this receptor induces a DB02527 - dependent signal which can be detected via a DB02527 - responsive luciferase construct . Tests with exogenously added adenosine confirmed that the resulting luminescence signals correlate with the respective adenosine levels and thus allow quantitative measurements in a range from 20 nM to 80 M free extracellular adenosine . Inhibition of adenosine uptake by dipyridamole further increased the sensitivity of the assay . We further validated our approach by quantifying the adenosine levels that are generated by regulatory T cells via ectonucleotidase-mediated cleavage of DB00171 . As expected , values returned to baseline when

 was inhibited . This confirmed that this new cell-based reporter assay constitutes a biologically relevant , technically easy , versatile , scalable and cost-effective approach that allows the non-radioactive quantification of adenosine as a signaling intermediate .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Clinical significance of arginase after liver transplantation . Liver graft function after transplantation is dependent on ischemia-reperfusion injury , toxicity of drugs ( immunosuppression , antibiotics and other ) and transplant rejection . Although routinely monitored with enzymatic tests ( Q9NRA2 , ALT ,

<div class="entities" style="line-height: 2.5; direction: ltr">Characterization of antihistamines using biphasic cutaneous reaction in BALB / c mice . Effects of 11 histamine H1 receptor antagonists on IgE-mediated biphasic cutaneous reaction in mice were examined . The immediate phase reaction ( IPR ) assessed at 1 hour after antigen application was significantly inhibited by all antihistamines examined . The inhibition of IPR by cetirizine and mequitazine were potent , but those by cyproheptadine and diphenhydramine were weak . The later phase reaction ( LPR ) assessed at 24 hours after antigen application was inhibited by chlorpheniramine , oxatomide , ketotifen , mequitazine , emedastine , terfenadine and azelastine . The inhibition of LPR by emedastine was potent , but those by ketotifen and terfenadine were only partial .

 inhibited both IPR and LPR comparably . Present results indicate that H1 receptor activation is involved in the IPR of the biphasic cutaneous reaction , and that the blockade of H1 receptors at IPR does not contribute to the attenuation of following LPR .

<div class="entities" style="line-height: 2.5; direction: ltr">Antibody-based immunotherapy for ovarian cancer : where are we at ? Cytoreductive surgery and chemotherapy continue to be the mainstay of ovarian cancer treatment . However , as mortality from advanced ovarian cancer remains very high , novel therapies are required to be integrated into existing treatment regimens . Immunotherapy represents an alternative and rational therapeutic approach for ovarian cancer based on a body of evidence supporting a protective role of the immune system against these cancers , and on the clinical success of immunotherapy in other malignancies . Whether or not immunotherapy will have a role in the future management of ovarian cancer is too early to tell , but research in this field is active . This review will discuss recent clinical developments of selected immunotherapies for ovarian cancer which fulfil the following criteria : ( i ) they are antibody-based , ( ii ) target a distinct immunological pathway , and ( iii ) have reached the clinical trial stage . Specifically , the focus is on Catumaxomab ( anti-EpCAM  anti-CD 3 ) , Abagovomab ,

 ( anti - Q8WXI7 ) , DB00111 ( anti-CD 25 ) , DB06186 ( anti -
